import React from 'react';
import sendPost from './api/hook';
import logo from './logo.svg';
import './App.css';

const data = await sendPost('http://localhost:8080/recentword',{test:'data'});
const disp = () => { return(data) }

function App() {
  return (
	  <div className="App">
	  	<header className="App-header">
	  		<img src={logo} className="App-logo" alt="logo" />
	  		<p>{disp}</p>
	  	</header>
	  </div>
  );
}

export default App;
